INSERT INTO `project_core_call` VALUES (1,'GreenLAnd Circumnavigation Expedition','GLACE','GLACE is the second major scientific expedition organised by the Swiss Polar Institute. It aims to complete the first circumnavigation of Greenland in August and September 2019. By gathering scientific observations all around Greenland, the expedition will be able to provide a unique holistic understanding of this region critically affected by climate change.',150000.00,'2019-10-07 08:10:00.000000','Reminder about eligibility criteria: \r\nPlease make sure to carefully read the eligibility rules for this call. Ineligible applications will not be forwarded for evaluation. Proposals for research projects, which are not clearly respecting the boundary conditions of the expedition (i.e. trajectory, vessel capacity or timeline) will be considered ineligible. \r\n\r\nA complete application file consists of:\r\n1) Online application form (contact and main information of PI and participants)\r\n2) Attachments to be uploaded along with the online form as pdf: \r\n	- CVs (max 2 pages) + publication list of the last 5 years for the PI and main collaborators\r\n\r\nIncomplete proposals will be considered ineligible. \r\n\r\nSubmission information: \r\nOnline submission: click here.  \r\nThe online submission form will be closed on the deadline date. No late applications will be considered – there can be no exceptions! \r\nShould you encounter any problem in the submission process, please contact: GLACE@epfl.ch. Please note however that trouble-shooting shortly before the deadline cannot be guaranteed and that SPI will not accept applications sent by email.','2019-11-25 09:10:00.000000',NULL,NULL,NULL,'2019-10-22 09:38:34.028220',NULL),(2,'Polar Access Fund 2019',NULL,'The Polar Access Fund should enable young researchers (see definition below) to undertake their first field trip to a polar region. The research conducted during the field trip must be inserted into an existing project (e.g. to enlarge its scope or for comparisons) and be related to the issue of climate change.\r\n\r\nFunding of up to 20’000 CHF can be granted per successfully evaluated proposal. The Polar Access Fund is an instrument co-funded by the Swiss Polar Institute and the BNP Paribas Swiss Foundation.',20000.00,'2020-05-13 10:00:00.000000','Reminder about eligibility rules: \r\nPlease make sure to study the eligibility rules for this call. Ineligible applications will not be submitted to evaluation. To be eligible, proposals must notably respect the definition of the Call’s target public  as well as the Call’s geographic focus. Proposals for field trips which are not taking place in the frame of an already approved and funded research project will be considered ineligible. \r\n\r\nA complete application file consists of:\r\nOnline application form (contact and main information)\r\nIncomplete proposals will be considered ineligible. \r\n\r\nSubmission information: \r\nThe online submission form will be closed on the deadline date. No late applications will be accepted – no exceptions! \r\nShould you encounter any problem in the submission process, contact: SPI-GRANTS@epfl.ch. Please note however that trouble-shooting in the last minutes before the deadline cannot be guaranteed and that SPI will not accept applications sent by email.','2020-07-31 10:00:00.000000',NULL,NULL,NULL,'2019-10-22 09:38:34.028220',NULL),(3,'Exploratory Grants 2019',NULL,'The SPI Exploratory Grants will support Swiss based scientists active in polar regions (including remote high-altitude regions such as the Andes and the Himalayas) by allowing them to launch short-term new ideas (for example pilot projects), fund additional field work or launch new collaborations with financial support for logistics. Collaboration with new teams or across disciplines are particularly encouraged, as well as participation in larger/international activities. The grants can be used to complement the funding of initiatives supported by larger funding schemes (e.g. SNSF, EU, etc.).',40000.00,'2018-08-01 10:00:00.000000','Reminder about eligibility rules: \r\n\r\nPlease make sure to study the eligibility rules for this call. Ineligible applications will not be submitted to evaluation. To be eligible, proposals must notably respect the call’s general aims, the definition of the call’s target public, eligible costs as well as geographic focus.\r\n\r\nA complete application file consists of:\r\n\r\nA) Online application form (contact and main information) +\r\nB) Attachments to be uploaded into online form as pdf:\r\n	CV of the applicant, incl. publication list in pdf (compulsory – free format)\r\n\r\nIncomplete proposals will be considered ineligible. \r\n\r\nSubmission information: \r\n\r\nThe online submission form will be closed on the deadline date. No late applications will be accepted – no exceptions! \r\nShould you encounter any problem in the submission process, contact: secretariat.spi@epfl.ch. \r\nPlease note however that trouble-shooting in the last minutes before the deadline cannot be guaranteed and that SPI will not accept applications sent by email.','2019-10-22 10:00:00.000000',NULL,NULL,NULL,'2019-10-22 09:38:34.028220','2019-10-22 12:32:55.452058'),(4,'SPI Technogrants 2019',NULL,'The SPI Technogrants will support Swiss groups developing technologies relevant for research in polar regions (and other extreme environments such as remote high-altitude regions). Technogrants can also serve the improvement and adaptation of technologies to extreme environments or support new technological developments to be used in the field for polar or remote high-altitude research.',50000.00,'2019-10-16 10:00:00.000000','Reminder about eligibility rules: \r\n\r\nPlease make sure to study the eligibility rules for this call closely. Ineligible applications will not be submitted to evaluation. To be eligible, proposals must notably respect the call’s general aims, the definition of the call’s target public, eligible costs as well as geographic focus.\r\n\r\nA complete application file consists of:\r\n\r\n- Online application form\r\n- CV of the applicant, incl. publication list in pdf (compulsory – free format)\r\n\r\nIncomplete proposals will be considered ineligible. \r\n\r\nSubmission information: \r\n\r\nAll applications must be submitted online.\r\n\r\nThe online submission form will be closed on the deadline date. No late applications will be accepted – no exceptions!\r\n\r\nShould you encounter any problem in the submission process, contact: spi-grants@epfl.ch . \r\nPlease note however that trouble-shooting in the last minutes before the deadline cannot be guaranteed and that SPI will not accept applications sent by email.','2019-12-27 11:00:00.000000',3,NULL,NULL,'2019-10-28 13:19:29.640217','2019-10-28 13:26:29.966910');
