INSERT INTO `project_core_callquestion` VALUES (1,'Summary of the research proposal','Text',500,1,'Please summarise the most important features of your research projects, place it in a broader scientific context and highlight synergies with wider scale scientific initiatives in the region.',1,1,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(2,'Description of the project','Text',2500,1,'Please outline the following elements (one separate part for each element):  1) status of research in the field; 2) relevance to the particular region of the expedition; 3) detailed research plan (including aims and methodology); 4) milestones and timeline for the research plan; 5) importance and impact; 6) feasibility of scientific research plan given the short lead-time to the expedition.',2,2,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(3,'Scientific partners','Text',NULL,1,'Please explain the synergies between the partners and the rationale behind the consortium (if relevant)',3,3,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(4,'Feasibility and technical requirements','Text',NULL,1,'Please give details of the following:\r\n- Number of berths required per leg\r\n- Type of work undertaken (terrestrial/oceanographic/…)\r\n- Technical requirements on board (instruments, specifications, …)\r\n- Technical instruments/equipment brought by the PI or project team and related space and technical requirements (power, software, …)\r\n- Type of logistical support needed (helicopter, small boat operations, field camp, …)\r\n- Time required per station/sampling event\r\n- Data management, storage, IT and communication requirements',4,4,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(5,'Synergies with other initiatives in the region','Text',NULL,1,'Please highlight here links and planned synergies with other national or international initiatives taking place in the Arctic.',5,5,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(6,'Other relevant information','Text',NULL,1,'',6,6,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(7,'Summary of the proposed field trip','Text',400,2,'Concise statement of the goals, milestones and significance of the field trip.',7,1,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(8,'Description of the scientific work to be undertaken during the field trip','Text',1600,2,'Outline the field trip’s scientific goals and methodology to be used.',8,2,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(9,'Scientific project towards which the field trip will contribute','Text',NULL,2,'Describe the existing scientific project into which the field trip would be inserted (incl. funding and duration).\r\nParticularly highlight the added-value of the field trip for the existing project as well as the project’s link with issues related to climate change.',9,3,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(10,'Feasibility and local partners','Text',NULL,2,'Compile a precise list of requirements (access to infrastructure, etc.)\r\nOutline the feasibility, existing local contacts or support and the logistics involved.',10,4,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(11,'List previous field trips in Polar regions (if any)','Text',NULL,2,'Please list destination, purpose, collaboration partners and duration.',11,5,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(12,'Additional aspects','Text',200,2,'Please highlight here any useful additional aspects',12,6,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(13,'References','Text',NULL,2,'Websites, links to publications, etc. which might be useful in assessing the proposed field trip',13,7,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(14,'References','Text',NULL,3,'Websites, links to publications, etc. which might be useful in assessing the proposed field trip',13,8,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(15,'Summary of the initiative/project proposed for funding','Text',400,3,'Concise statement on the goals, the most important features and the significance of the initiative/project proposed for funding',14,1,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(16,'Description of the initiative/project proposed for funding','Text',1600,3,'Please outline the following elements (one separate part for each element):  1) status of research in the field; 2) detailed research plan (including aims and methodology); 3) milestones and timeline for the research plan; 4) feasibility of scientific research plan; 5) importance and impact of the proposed project',15,3,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(17,'Use of the requested funds','Text',NULL,3,'Please explain why additional funding is crucial for the success of the initiative/project and what impact the SPI funding would have on the overall project. If additional funding has been secured (SNSF, EU, private foundations, etc.), please specify what the SPI Exploratory Grant would be used for in case of a successful evaluation (added value).',16,4,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(18,'Logistics and local partners','Text',NULL,3,'Compile a precise list of requirements (access to infrastructure, etc.)\r\nOutline the feasibility, existing local contacts or support and the logistics involved.',17,5,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(19,'Scientific partners','Text',400,3,'Please explain the synergies between the partners and the rationale behind the consortium (if relevant). Describe the scientific partners in the project, including the PI, specifying their name, career stage, institution, country, key competences relating to the research undertaken and role in the project.',18,6,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(20,'Additional information','Text',200,3,'Please highlight here any useful additional points.',19,7,NULL,'2019-10-22 09:38:34.497959',NULL,NULL),(21,'Summary of the project proposed for funding','Text',400,4,'Concise statement on the goals, the most important features and the significance of the proposed project/technology development for funding',14,1,NULL,'2019-10-28 13:19:29.670916',NULL,'2019-10-28 13:21:39.097835'),(22,'Description of the initiative/project proposed for funding','Text',1600,4,'Please outline the following elements (one separate part for each element):  1) innovative dimensions of the technology to be developed; 2) detailed technology development plan; 3) milestones and timeline for the technology development plan; 4) feasibility of the development plan; 5) importance and impact of the proposed project on science in polar regions.',15,2,NULL,'2019-10-28 13:19:29.681186',NULL,'2019-10-28 13:21:39.105240'),(23,'Use of the requested funds','Text',NULL,4,'Please explain why additional funding is crucial for the success of the project and what impact the SPI funding would have on the overall development of the technology. If additional funding has been secured (SNSF, EU, private foundations, etc.), please specify what the SPI Technogrant would be used for in case of a successful evaluation (added value).',16,3,NULL,'2019-10-28 13:19:29.692360',NULL,'2019-10-28 13:21:39.112562'),(24,'Logistics and local partners','Text',NULL,4,'Compile a precise list of requirements (access to infrastructure, shipping, etc.).\r\nOutline the feasibility, existing local contacts or support and the logistics involved.',17,4,NULL,'2019-10-28 13:19:29.703306',NULL,'2019-10-28 13:21:39.119964'),(25,'References','Text',NULL,4,'Websites, links to publications, etc. which might be useful in assessing the proposed project',13,10,NULL,'2019-10-28 13:24:05.780759',NULL,'2019-10-28 13:25:20.033193'),(26,'Additional information','Text',200,4,'Please highlight here any useful additional points.',19,9,NULL,'2019-10-28 13:24:05.809464',NULL,'2019-10-28 13:25:20.046204'),(27,'Partners','Text',400,4,'Please explain the synergies between the partners and the rationale behind the consortium (if relevant). Describe the key competences and role of the scientific partners in the project. Actors from the private sector acting as partners in the proposal should also be mentioned here. Specify their role and contribution to the project.',20,7,NULL,'2019-10-28 13:24:05.820497',NULL,'2019-10-28 13:24:05.820533');
