INSERT INTO `project_core_fundinginstrument` VALUES (1,'SPI Exploratory Grants',NULL,'The SPI Exploratory Grants will support Swiss based scientists active in polar regions (including remote high-altitude regions such as the Andes and the Himalayas) by allowing them to launch short-term new ideas (for example pilot projects), fund additional field work or launch new collaborations with financial support for logistics. Collaboration with new teams or across disciplines are particularly encouraged, as well as participation in larger/international activities. The grants can be used to complement the funding of initiatives supported by larger funding schemes (e.g. SNSF, EU, etc.).',NULL,NULL,'2019-10-25 16:38:14.054756','2019-10-25 16:38:14.054822'),(2,'Polar Access Fund',NULL,'The Polar Access Fund should enable young researchers (see definition below) to undertake their first field trip to a polar region. The research conducted during the field trip must be inserted into an existing project (e.g. to enlarge its scope or for comparisons) and be related to the issue of climate change.\r\n\r\nFunding of up to 20’000 CHF can be granted per successfully evaluated proposal. The Polar Access Fund is an instrument co-funded by the Swiss Polar Institute and the BNP Paribas Swiss Foundation.',NULL,NULL,'2019-10-25 16:38:28.304880','2019-10-25 16:38:28.304924'),(3,'SPI Technogrants',NULL,'The SPI Technogrants will support Swiss groups developing technologies relevant for research in polar regions (and other extreme environments such as remote high-altitude regions). Technogrants can also serve the improvement and adaptation of technologies to extreme environments or support new technological developments to be used in the field for polar or remote high-altitude research.',NULL,NULL,'2019-10-25 16:38:44.975760','2019-10-25 16:38:44.975796');
