INSERT INTO `project_core_proposalqatext` VALUES (1,'In this project we will investigate the species richness of the invertebrates inhabiting the islands around Greenland.',1,1,NULL,'2019-10-23 08:04:05.354156',NULL,'2019-10-23 16:23:19.308965'),(2,'We will spend time on the islands collecting invertebrates and sorting them. Identification will take place on the islands and also when back in the laboratory.',2,1,NULL,'2019-10-23 08:04:05.372893',NULL,'2019-10-23 16:23:19.321365'),(3,'We will work closely with invertebrate group experts from universities and museums around the world, and collaborate closely with the staff on bases.',3,1,NULL,'2019-10-23 08:04:05.388152',NULL,'2019-10-23 16:23:19.332006'),(4,'Collection of invertebrates does not rely on any technical equipment and is very low in terms of risk of not being able to collect a wide enough set of specimens. We require time on the islands.',4,1,NULL,'2019-10-23 08:04:05.396972',NULL,'2019-10-23 16:23:19.342599'),(5,'We will link our research with others studying invertebrates on other islands in different regions and look at the populations on other nearby land masses.',5,1,NULL,'2019-10-23 08:04:05.405199',NULL,'2019-10-23 16:23:19.353258'),(6,'We have previous experience working in this region.',6,1,NULL,'2019-10-23 08:04:05.414155',NULL,'2019-10-23 16:23:19.365502'),(7,'Investigations of the physical oceanography of the Arctic Ocean during the spring based on a ship.',7,2,NULL,'2019-10-23 09:22:19.248539',NULL,'2019-10-23 16:58:35.921364'),(8,'Based on a logistics ship I will carry out hand-held  CTD deployments with sensors and collect water samples at regular intervals.',8,2,NULL,'2019-10-23 09:22:19.270913',NULL,'2019-10-23 16:58:35.932060'),(9,'I am looking at the changes in the physical oceanography of the Arctic Ocean throughout the seasons.',9,2,NULL,'2019-10-23 09:22:19.284397',NULL,'2019-10-23 16:58:35.943852'),(10,'Already have partnership with the logistics company whose ship will be used. Regular route taken at this time of year.',10,2,NULL,'2019-10-23 09:22:19.292740',NULL,'2019-10-23 16:58:35.958347'),(11,'- Same location but during autumn on same vessel\r\n- Antarctic oceanography work',11,2,NULL,'2019-10-23 09:22:19.301047',NULL,'2019-10-23 16:58:35.973027'),(12,'Work will be partnered with logistics company. We will make all data freely available immediately.',12,2,NULL,'2019-10-23 09:22:19.313036',NULL,'2019-10-23 16:58:35.987676'),(13,'www.projectwebsite.com',13,2,NULL,'2019-10-23 09:22:19.327809',NULL,'2019-10-23 16:58:36.002857'),(14,'Develop software for operating and monitoring remotely-deployed meteorological stations that can be left on ice floes until they melt.',21,3,NULL,'2019-10-28 13:43:15.952786',NULL,'2019-10-28 13:48:52.738314'),(15,'We have a meteorological station that can be deployed on ice floes to monitor the meteorological conditions. Longevity depends on the time it takes for the ice to melt. The station will float until picked up or discovered. Each station contains a beacon that will send out a signal for five years. We need to create some software that allows the station to be monitored, download the data and follow it during its lifetime.',22,3,NULL,'2019-10-28 13:43:15.966937',NULL,'2019-10-28 13:48:52.752020'),(16,'Funds will contribute to the software deveolpment, tools required and project development between the research unit, computer science team and software developer.',23,3,NULL,'2019-10-28 13:43:15.975925',NULL,'2019-10-28 13:48:52.764930'),(17,'Meteorological institute - provide expertise into the development of the weather station and how the data should be used\r\nComputer science - expertise on how the beacon device works and a software engineer for the development of the software',24,3,NULL,'2019-10-28 13:43:15.985081',NULL,'2019-10-28 13:48:52.778126'),(18,'Ms A is a meteorologist specialising in the Arctic. Has undertaken several campaigns in this region. Currently maintains a network of meteorological stations in high-altitude areas. \r\nMr B is a technician who has developed the meteroloical station that will be used. \r\nMrs C is a software engineer that will develop the software. \r\nDr D will provide project management expertise.\r\nProf E provides the opportunity to deploy the meteorological stations.',27,3,NULL,'2019-10-28 13:43:16.006582',NULL,'2019-10-28 13:48:52.791546'),(19,'Extra information about the project can be found by seeing the project wesbite.',26,3,NULL,'2019-10-28 13:43:16.020939',NULL,'2019-10-28 13:48:52.805057'),(20,'Met station website.',25,3,NULL,'2019-10-28 13:43:16.033706',NULL,'2019-10-28 13:48:52.820801');
/*!40000 ALTER TABLE `project_core_proposalqatext` ENABLE KEYS */;
UNLOCK TABLES;

