INSERT INTO `project_core_templatequestion` VALUES (1,'Summary of the research proposal','Please summarise the most important features of your research projects, place it in a broader scientific context and highlight synergies with wider scale scientific initiatives in the region.','Text',500,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(2,'Description of the project','Please outline the following elements (one separate part for each element):  1) status of research in the field; 2) relevance to the particular region of the expedition; 3) detailed research plan (including aims and methodology); 4) milestones and timeline for the research plan; 5) importance and impact; 6) feasibility of scientific research plan given the short lead-time to the expedition.','Text',2500,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(3,'Scientific partners','Please explain the synergies between the partners and the rationale behind the consortium (if relevant)','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(4,'Feasibility and technical requirements','Please give details of the following:\r\n- Number of berths required per leg\r\n- Type of work undertaken (terrestrial/oceanographic/…)\r\n- Technical requirements on board (instruments, specifications, …)\r\n- Technical instruments/equipment brought by the PI or project team and related space and technical requirements (power, software, …)\r\n- Type of logistical support needed (helicopter, small boat operations, field camp, …)\r\n- Time required per station/sampling event\r\n- Data management, storage, IT and communication requirements','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(5,'Synergies with other initiatives in the region','Please highlight here links and planned synergies with other national or international initiatives taking place in the Arctic.','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(6,'Other relevant information','','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(7,'Summary of the proposed field trip','Concise statement of the goals, milestones and significance of the field trip.','Text',400,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(8,'Description of the scientific work to be undertaken during the field trip','Outline the field trip’s scientific goals and methodology to be used.','Text',1600,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(9,'Scientific project towards which the field trip will contribute','Describe the existing scientific project into which the field trip would be inserted (incl. funding and duration).\r\nParticularly highlight the added-value of the field trip for the existing project as well as the project’s link with issues related to climate change.','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(10,'Feasibility and local partners','Compile a precise list of requirements (access to infrastructure, etc.)\r\nOutline the feasibility, existing local contacts or support and the logistics involved.','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(11,'List previous field trips in Polar regions (if any)','Please list destination, purpose, collaboration partners and duration.','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(12,'Additional aspects','Please highlight here any useful additional aspects','Text',200,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(13,'References','Websites, links to publications, etc. which might be useful in assessing the proposed field trip','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(14,'Summary of the initiative/project proposed for funding','Concise statement on the goals, the most important features and the significance of the initiative/project proposed for funding','Text',400,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(15,'Description of the initiative/project proposed for funding','Please outline the following elements (one separate part for each element):  1) status of research in the field; 2) detailed research plan (including aims and methodology); 3) milestones and timeline for the research plan; 4) feasibility of scientific research plan; 5) importance and impact of the proposed project','Text',1600,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(16,'Use of the requested funds','Please explain why additional funding is crucial for the success of the initiative/project and what impact the SPI funding would have on the overall project. If additional funding has been secured (SNSF, EU, private foundations, etc.), please specify what the SPI Exploratory Grant would be used for in case of a successful evaluation (added value).','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(17,'Logistics and local partners','Compile a precise list of requirements (access to infrastructure, etc.)\r\nOutline the feasibility, existing local contacts or support and the logistics involved.','Text',NULL,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(18,'Scientific partners','Please explain the synergies between the partners and the rationale behind the consortium (if relevant). Describe the scientific partners in the project, including the PI, specifying their name, career stage, institution, country, key competences relating to the research undertaken and role in the project.','Text',400,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(19,'Additional information','Please highlight here any useful additional points.','Text',200,NULL,'2019-10-22 09:38:34.606071',NULL,NULL),(20,'Partners','Please explain the synergies between the partners and the rationale behind the consortium (if relevant). Describe the key competences and role of the scientific partners in the project. Actors from the private sector acting as partners in the proposal should also be mentioned here. Specify their role and contribution to the project.','Text',400,NULL,'2019-10-28 13:23:23.654652',NULL,'2019-10-28 13:23:23.654705');
